class AppComponent {
    constructor(api, helper, ui) {
        this.api = api;
        this.helper = helper;
        this.ui = ui;
        //title = 'cowin-angular';
        this.selectedState = "";
        this.selectedDistrict = "";
        this.stateList = [];
        this.districtData = [];
        this.vaccineType = "COVAXIN";
        this.ageGroup = "18";
        this.vaccineFee = "Free";
        this.dose = "dose1";
        this.date = new Date();
        this.listOfData = [];
        this.mobile = "";
        this.otp = '';
        this.txnId = '';
        this.showCancel = false;
        this.disableMobile = false;
        this.disableOtp = true;
        this.refreshTime = 5; //seconds
        this.isRefresh = false;
        //this.date = new Date();
    }
    /**
     *
     */
    ngOnInit() {
        this.api.getStates()
            .subscribe(data => {
            this.stateList = data['states'];
        });
        this.vaccineType = "COVAXIN";
        //this.date = new Date();
    }
    /**
     *
     * @param value
     */
    onChangeState(value) {
        this.districtData = [];
        this.api.getDistricts(this.selectedState).subscribe(data => {
            this.districtData = data['districts'];
        });
    }
    getDistrictsSessions(value) {
        this.api.getDistrictData(value, this.helper.getMMDDYYYY_calendar(this.date)).subscribe(data => {
            this.listOfData = [];
            //this.ui.generateTable(data,  this.listOfData, this.ageGroup);
        });
    }
    /**
     *
     */
    refreshData() {
        setInterval(() => {
            console.log('setTimeOut');
            if (this.isRefresh)
                this.getHospitalData();
        }, this.refreshTime * 1000);
    }
    /**
     *
     * @param value
     */
    getHospitalData() {
        if (this.selectedState == '' && this.selectedDistrict == '')
            return;
        this.isRefresh = true;
        this.api.getDistrictData(this.selectedDistrict, this.helper.getMMDDYYYY_calendar(this.date)).subscribe(data => {
            this.listOfData = this.ui.generateTable(data, this.listOfData, this.ageGroup, this.vaccineType, this.vaccineFee);
        });
        //this.refreshData()
    }
    sendOtp() {
        this.disableMobile = true;
        this.disableOtp = false;
        this.api.getOtp(this.mobile).subscribe(data => {
            this.txnId = data['txnId'];
        });
    }
    validateOtp() {
        this.api.validateOtp(this.otp, this.txnId).subscribe(data => {
            localStorage.setItem("token", data['token']);
        });
    }
    cancelLogin() {
        this.showCancel = false;
        this.disableMobile = false;
        this.disableOtp = true;
        localStorage.clear();
    }
    stopRefresh() {
        this.isRefresh = false;
    }
}
